@testset "7.1.5 Inverse hyperbolic sine functions" begin
    @variables a, b, c, d, e, f, g, h, m, n, x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*u*(a+b*asinh(c*x))^n=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d+e*x)^m*(a+b*asinh(c*x))^n=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(d+e*x)^m*asinh(c*x)^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [asinh(c*x)^1/(d + e*x), x, 8, -(asinh(c*x)^2/(2*e)) + (asinh(c*x)*log(1 + (e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2))))/e + (asinh(c*x)*log(1 + (e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2))))/e + PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2))))/e + PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2))))/e]


    @test_int [asinh(c*x)^2/(d + e*x), x, 10, -(asinh(c*x)^3/(3*e)) + (asinh(c*x)^2*log(1 + (e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2))))/e + (asinh(c*x)^2*log(1 + (e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2))))/e + (2*asinh(c*x)*PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2)))))/e + (2*asinh(c*x)*PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2)))))/e - (2*PolyLog(3, -((e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2)))))/e - (2*PolyLog(3, -((e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2)))))/e]


    @test_int [asinh(c*x)^3/(d + e*x), x, 12, -(asinh(c*x)^4/(4*e)) + (asinh(c*x)^3*log(1 + (e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2))))/e + (asinh(c*x)^3*log(1 + (e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2))))/e + (3*asinh(c*x)^2*PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2)))))/e + (3*asinh(c*x)^2*PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2)))))/e - (6*asinh(c*x)*PolyLog(3, -((e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2)))))/e - (6*asinh(c*x)*PolyLog(3, -((e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2)))))/e + (6*PolyLog(4, -((e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2)))))/e + (6*PolyLog(4, -((e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2)))))/e]


    #= ::Subsubsection:: =#
    #=n<0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(d+e*x)^m*(a+b*asinh(c*x))^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [(d + e*x)^3*(a + b*asinh(c*x)), x, 5, -((7*b*d*(d + e*x)^2*sqrt(1 + c^2*x^2))/(48*c)) - (b*(d + e*x)^3*sqrt(1 + c^2*x^2))/(16*c) - (b*(4*d*(19*c^2*d^2 - 16*e^2) + e*(26*c^2*d^2 - 9*e^2)*x)*sqrt(1 + c^2*x^2))/(96*c^3) - (b*(8*c^4*d^4 - 24*c^2*d^2*e^2 + 3*e^4)*asinh(c*x))/(32*c^4*e) + ((d + e*x)^4*(a + b*asinh(c*x)))/(4*e)]
    @test_int [(d + e*x)^2*(a + b*asinh(c*x)), x, 4, -((b*(d + e*x)^2*sqrt(1 + c^2*x^2))/(9*c)) - (b*(4*(4*c^2*d^2 - e^2) + 5*c^2*d*e*x)*sqrt(1 + c^2*x^2))/(18*c^3) - (b*d*(2*d^2 - (3*e^2)/c^2)*asinh(c*x))/(6*e) + ((d + e*x)^3*(a + b*asinh(c*x)))/(3*e)]
    @test_int [(d + e*x)^1*(a + b*asinh(c*x)), x, 4, -((3*b*d*sqrt(1 + c^2*x^2))/(4*c)) - (b*(d + e*x)*sqrt(1 + c^2*x^2))/(4*c) - (b*(2*d^2 - e^2/c^2)*asinh(c*x))/(4*e) + ((d + e*x)^2*(a + b*asinh(c*x)))/(2*e)]
    @test_int [(d + e*x)^0*(a + b*asinh(c*x)), x, 3, a*x - (b*sqrt(1 + c^2*x^2))/c + b*x*asinh(c*x)]
    @test_int [(a + b*asinh(c*x))/(d + e*x)^1, x, 8, -((a + b*asinh(c*x))^2/(2*b*e)) + ((a + b*asinh(c*x))*log(1 + (e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2))))/e + ((a + b*asinh(c*x))*log(1 + (e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2))))/e + (b*PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2)))))/e + (b*PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2)))))/e]
    @test_int [(a + b*asinh(c*x))/(d + e*x)^2, x, 3, -((a + b*asinh(c*x))/(e*(d + e*x))) - (b*c*atanh((e - c^2*d*x)/(sqrt(c^2*d^2 + e^2)*sqrt(1 + c^2*x^2))))/(e*sqrt(c^2*d^2 + e^2))]
    @test_int [(a + b*asinh(c*x))/(d + e*x)^3, x, 4, -((b*c*sqrt(1 + c^2*x^2))/(2*(c^2*d^2 + e^2)*(d + e*x))) - (a + b*asinh(c*x))/(2*e*(d + e*x)^2) - (b*c^3*d*atanh((e - c^2*d*x)/(sqrt(c^2*d^2 + e^2)*sqrt(1 + c^2*x^2))))/(2*e*(c^2*d^2 + e^2)^(3/2))]
    @test_int [(a + b*asinh(c*x))/(d + e*x)^4, x, 5, -((b*c*sqrt(1 + c^2*x^2))/(6*(c^2*d^2 + e^2)*(d + e*x)^2)) - (b*c^3*d*sqrt(1 + c^2*x^2))/(2*(c^2*d^2 + e^2)^2*(d + e*x)) - (a + b*asinh(c*x))/(3*e*(d + e*x)^3) - (b*c^3*(2*c^2*d^2 - e^2)*atanh((e - c^2*d*x)/(sqrt(c^2*d^2 + e^2)*sqrt(1 + c^2*x^2))))/(6*e*(c^2*d^2 + e^2)^(5/2))]


    @test_int [(d + e*x)^3*(a + b*asinh(c*x))^2, x, 18, 2*b^2*d^3*x - (4*b^2*d*e^2*x)/(3*c^2) + (3/4)*b^2*d^2*e*x^2 - (3*b^2*e^3*x^2)/(32*c^2) + (2/9)*b^2*d*e^2*x^3 + (1/32)*b^2*e^3*x^4 - (2*b*d^3*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/c + (4*b*d*e^2*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/(3*c^3) - (3*b*d^2*e*x*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/(2*c) + (3*b*e^3*x*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/(16*c^3) - (2*b*d*e^2*x^2*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/(3*c) - (b*e^3*x^3*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/(8*c) - (d^4*(a + b*asinh(c*x))^2)/(4*e) + (3*d^2*e*(a + b*asinh(c*x))^2)/(4*c^2) - (3*e^3*(a + b*asinh(c*x))^2)/(32*c^4) + ((d + e*x)^4*(a + b*asinh(c*x))^2)/(4*e)]
    @test_int [(d + e*x)^2*(a + b*asinh(c*x))^2, x, 13, 2*b^2*d^2*x - (4*b^2*e^2*x)/(9*c^2) + (1/2)*b^2*d*e*x^2 + (2/27)*b^2*e^2*x^3 - (2*b*d^2*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/c + (4*b*e^2*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/(9*c^3) - (b*d*e*x*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/c - (2*b*e^2*x^2*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/(9*c) - (d^3*(a + b*asinh(c*x))^2)/(3*e) + (d*e*(a + b*asinh(c*x))^2)/(2*c^2) + ((d + e*x)^3*(a + b*asinh(c*x))^2)/(3*e)]
    @test_int [(d + e*x)^1*(a + b*asinh(c*x))^2, x, 9, 2*b^2*d*x + (1/4)*b^2*e*x^2 - (2*b*d*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/c - (b*e*x*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/(2*c) - (d^2*(a + b*asinh(c*x))^2)/(2*e) + (e*(a + b*asinh(c*x))^2)/(4*c^2) + ((d + e*x)^2*(a + b*asinh(c*x))^2)/(2*e)]
    @test_int [(d + e*x)^0*(a + b*asinh(c*x))^2, x, 3, 2*b^2*x - (2*b*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/c + x*(a + b*asinh(c*x))^2]
    @test_int [(a + b*asinh(c*x))^2/(d + e*x)^1, x, 10, -((a + b*asinh(c*x))^3/(3*b*e)) + ((a + b*asinh(c*x))^2*log(1 + (e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2))))/e + ((a + b*asinh(c*x))^2*log(1 + (e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2))))/e + (2*b*(a + b*asinh(c*x))*PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2)))))/e + (2*b*(a + b*asinh(c*x))*PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2)))))/e - (2*b^2*PolyLog(3, -((e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2)))))/e - (2*b^2*PolyLog(3, -((e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2)))))/e]
    @test_int [(a + b*asinh(c*x))^2/(d + e*x)^2, x, 10, -((a + b*asinh(c*x))^2/(e*(d + e*x))) + (2*b*c*(a + b*asinh(c*x))*log(1 + (e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2))))/(e*sqrt(c^2*d^2 + e^2)) - (2*b*c*(a + b*asinh(c*x))*log(1 + (e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2))))/(e*sqrt(c^2*d^2 + e^2)) + (2*b^2*c*PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2)))))/(e*sqrt(c^2*d^2 + e^2)) - (2*b^2*c*PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2)))))/(e*sqrt(c^2*d^2 + e^2))]
    @test_int [(a + b*asinh(c*x))^2/(d + e*x)^3, x, 13, -((b*c*sqrt(1 + c^2*x^2)*(a + b*asinh(c*x)))/((c^2*d^2 + e^2)*(d + e*x))) - (a + b*asinh(c*x))^2/(2*e*(d + e*x)^2) + (b*c^3*d*(a + b*asinh(c*x))*log(1 + (e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2))))/(e*(c^2*d^2 + e^2)^(3/2)) - (b*c^3*d*(a + b*asinh(c*x))*log(1 + (e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2))))/(e*(c^2*d^2 + e^2)^(3/2)) + (b^2*c^2*log(d + e*x))/(e*(c^2*d^2 + e^2)) + (b^2*c^3*d*PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d - sqrt(c^2*d^2 + e^2)))))/(e*(c^2*d^2 + e^2)^(3/2)) - (b^2*c^3*d*PolyLog(2, -((e*ℯ^asinh(c*x))/(c*d + sqrt(c^2*d^2 + e^2)))))/(e*(c^2*d^2 + e^2)^(3/2))]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [(d + e*x)^3/(a + b*asinh(c*x)), x, 27, (d^3*cosh(a/b)*CoshIntegral(a/b + asinh(c*x)))/(b*c) - (3*d*e^2*cosh(a/b)*CoshIntegral(a/b + asinh(c*x)))/(4*b*c^3) + (3*d*e^2*cosh((3*a)/b)*CoshIntegral((3*a)/b + 3*asinh(c*x)))/(4*b*c^3) - (3*d^2*e*CoshIntegral((2*a)/b + 2*asinh(c*x))*sinh((2*a)/b))/(2*b*c^2) + (e^3*CoshIntegral((2*a)/b + 2*asinh(c*x))*sinh((2*a)/b))/(4*b*c^4) - (e^3*CoshIntegral((4*a)/b + 4*asinh(c*x))*sinh((4*a)/b))/(8*b*c^4) - (d^3*sinh(a/b)*SinhIntegral(a/b + asinh(c*x)))/(b*c) + (3*d*e^2*sinh(a/b)*SinhIntegral(a/b + asinh(c*x)))/(4*b*c^3) + (3*d^2*e*cosh((2*a)/b)*SinhIntegral((2*a)/b + 2*asinh(c*x)))/(2*b*c^2) - (e^3*cosh((2*a)/b)*SinhIntegral((2*a)/b + 2*asinh(c*x)))/(4*b*c^4) - (3*d*e^2*sinh((3*a)/b)*SinhIntegral((3*a)/b + 3*asinh(c*x)))/(4*b*c^3) + (e^3*cosh((4*a)/b)*SinhIntegral((4*a)/b + 4*asinh(c*x)))/(8*b*c^4)]
    @test_int [(d + e*x)^2/(a + b*asinh(c*x)), x, 17, (d^2*cosh(a/b)*CoshIntegral(a/b + asinh(c*x)))/(b*c) - (e^2*cosh(a/b)*CoshIntegral(a/b + asinh(c*x)))/(4*b*c^3) + (e^2*cosh((3*a)/b)*CoshIntegral((3*a)/b + 3*asinh(c*x)))/(4*b*c^3) - (d*e*CoshIntegral((2*a)/b + 2*asinh(c*x))*sinh((2*a)/b))/(b*c^2) - (d^2*sinh(a/b)*SinhIntegral(a/b + asinh(c*x)))/(b*c) + (e^2*sinh(a/b)*SinhIntegral(a/b + asinh(c*x)))/(4*b*c^3) + (d*e*cosh((2*a)/b)*SinhIntegral((2*a)/b + 2*asinh(c*x)))/(b*c^2) - (e^2*sinh((3*a)/b)*SinhIntegral((3*a)/b + 3*asinh(c*x)))/(4*b*c^3)]
    @test_int [(d + e*x)^1/(a + b*asinh(c*x)), x, 11, (d*cosh(a/b)*CoshIntegral(a/b + asinh(c*x)))/(b*c) - (e*CoshIntegral((2*a)/b + 2*asinh(c*x))*sinh((2*a)/b))/(2*b*c^2) - (d*sinh(a/b)*SinhIntegral(a/b + asinh(c*x)))/(b*c) + (e*cosh((2*a)/b)*SinhIntegral((2*a)/b + 2*asinh(c*x)))/(2*b*c^2)]
    @test_int [(d + e*x)^0/(a + b*asinh(c*x)), x, 4, (cosh(a/b)*CoshIntegral((a + b*asinh(c*x))/b))/(b*c) - (sinh(a/b)*SinhIntegral((a + b*asinh(c*x))/b))/(b*c)]
    @test_int [1/((d + e*x)^1*(a + b*asinh(c*x))), x, 0, Unintegrable(1/((d + e*x)*(a + b*asinh(c*x))), x)]
    @test_int [1/((d + e*x)^2*(a + b*asinh(c*x))), x, 0, Unintegrable(1/((d + e*x)^2*(a + b*asinh(c*x))), x)]


    @test_int [(d + e*x)^2/(a + b*asinh(c*x))^2, x, 19, -((d^2*sqrt(1 + c^2*x^2))/(b*c*(a + b*asinh(c*x)))) - (2*d*e*x*sqrt(1 + c^2*x^2))/(b*c*(a + b*asinh(c*x))) - (e^2*x^2*sqrt(1 + c^2*x^2))/(b*c*(a + b*asinh(c*x))) + (2*d*e*cosh((2*a)/b)*CoshIntegral((2*(a + b*asinh(c*x)))/b))/(b^2*c^2) - (d^2*CoshIntegral((a + b*asinh(c*x))/b)*sinh(a/b))/(b^2*c) + (e^2*CoshIntegral((a + b*asinh(c*x))/b)*sinh(a/b))/(4*b^2*c^3) - (3*e^2*CoshIntegral((3*(a + b*asinh(c*x)))/b)*sinh((3*a)/b))/(4*b^2*c^3) + (d^2*cosh(a/b)*SinhIntegral((a + b*asinh(c*x))/b))/(b^2*c) - (e^2*cosh(a/b)*SinhIntegral((a + b*asinh(c*x))/b))/(4*b^2*c^3) - (2*d*e*sinh((2*a)/b)*SinhIntegral((2*(a + b*asinh(c*x)))/b))/(b^2*c^2) + (3*e^2*cosh((3*a)/b)*SinhIntegral((3*(a + b*asinh(c*x)))/b))/(4*b^2*c^3)]
    @test_int [(d + e*x)^1/(a + b*asinh(c*x))^2, x, 11, -((d*sqrt(1 + c^2*x^2))/(b*c*(a + b*asinh(c*x)))) - (e*x*sqrt(1 + c^2*x^2))/(b*c*(a + b*asinh(c*x))) + (e*cosh((2*a)/b)*CoshIntegral((2*(a + b*asinh(c*x)))/b))/(b^2*c^2) - (d*CoshIntegral((a + b*asinh(c*x))/b)*sinh(a/b))/(b^2*c) + (d*cosh(a/b)*SinhIntegral((a + b*asinh(c*x))/b))/(b^2*c) - (e*sinh((2*a)/b)*SinhIntegral((2*(a + b*asinh(c*x)))/b))/(b^2*c^2)]
    @test_int [(d + e*x)^0/(a + b*asinh(c*x))^2, x, 5, -(sqrt(1 + c^2*x^2)/(b*c*(a + b*asinh(c*x)))) - (CoshIntegral((a + b*asinh(c*x))/b)*sinh(a/b))/(b^2*c) + (cosh(a/b)*SinhIntegral((a + b*asinh(c*x))/b))/(b^2*c)]
    @test_int [1/((d + e*x)^1*(a + b*asinh(c*x))^2), x, 0, Unintegrable(1/((d + e*x)*(a + b*asinh(c*x))^2), x)]
    @test_int [1/((d + e*x)^2*(a + b*asinh(c*x))^2), x, 0, Unintegrable(1/((d + e*x)^2*(a + b*asinh(c*x))^2), x)]


    #= ::Subsection:: =#
    #=Integrands*of*the*form*(d+e*x)^m*(a+b*asinh(c*x))^(n/2)=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(d+e*x)^m*(a+b*asinh(c*x))^n*with*m*symbolic=#


    @test_int [(d + e*x)^m*(a + b*asinh(c*x))^2, x, 1, ((d + e*x)^(1 + m)*(a + b*asinh(c*x))^2)/(e*(1 + m)) - (2*b*c*Unintegrable(((d + e*x)^(1 + m)*(a + b*asinh(c*x)))/sqrt(1 + c^2*x^2), x))/(e*(1 + m))]
    @test_int [(d + e*x)^m*(a + b*asinh(c*x))^1, x, 3, -((b*c*(d + e*x)^(2 + m)*sqrt(1 - (d + e*x)/(d - e/sqrt(-c^2)))*sqrt(1 - (d + e*x)/(d + e/sqrt(-c^2)))*AppellF1(2 + m, 1/2, 1/2, 3 + m, (d + e*x)/(d - e/sqrt(-c^2)), (d + e*x)/(d + e/sqrt(-c^2))))/(e^2*(1 + m)*(2 + m)*sqrt(1 + c^2*x^2))) + ((d + e*x)^(1 + m)*(a + b*asinh(c*x)))/(e*(1 + m))]
    @test_int [(d + e*x)^m/(a + b*asinh(c*x))^1, x, 0, Unintegrable((d + e*x)^m/(a + b*asinh(c*x)), x)]
    @test_int [(d + e*x)^m/(a + b*asinh(c*x))^2, x, 0, Unintegrable((d + e*x)^m/(a + b*asinh(c*x))^2, x)]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(f+g*x)^m*(d+e*x^2)^p*(a+b*asinh(c*x))^n*where*e=c^2*d=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(f+g*x)^m*(d+c^2*d*x^2)^(p/2)*(a+b*asinh(c*x))^n=#


